  false,\n\t\"url\": null,\n\t\"notes\": \"Watershed Sciences, Inc. collected Light
  Detection and Ranging (LiDAR) data for the U.S. Geological Survey (USGS) Umpqua
  River study site in collaboration with the Puget Sound LiDAR Consortium (PSLC).
  The areas for LiDAR collection have been designed as part of a collaborative effort
  of state, federal, and local agencies in order to meet a wide range of project goals.
  This LiDAR data set was collected between April 21 - July 13, 2009 and falls in
  Douglas County, Oregon. This data set consists of bare earth and unclassified points.
  The average pulse density is 8.80 pulses per square meter over terrestrial surfaces.
  The area of interest (AOI) encompasses approximately 67,408 acres and the total
  area flown (TAF) covers 69,925 acres. The TAF acreage is greater than the original
  AOI acreage due to buffering and flight planning optimization. In some areas of
  heavy vegetation or forest cover, there may be relatively few ground points in the
  LiDAR data. Elevation values for open water surfaces are not valid elevation values
  because few lidar points are returned from water surfaces. Lidar intensity values
  were also collected.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
